    false,nt"url": null,nt"notes": "The Lower Souris Migratory Waterfowl Refuge
    (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
    of the Canadian border in North Dakota. The refuge was established and constructed
    by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
    events taking place on the refuge in January of 1938. The month was mild, for a
    winter. Not one day was lost from the regular programs. The lack of snow, however,
    is proving to be worrisome for water levels in the coming spring. The cover mapping
    project was completed for 24 of the settlements made over the summer. The ten feeding
    stations have all been formed and are being used by the birds. In addition, the
    Highway #5 job was completed this month. A large crew of men have been kept at work
    in the u201cwoodsu201d thinning and cutting timber. The predator control program
    has also continued, with less success than in previous years. A series of photographs
    from December conclude the report.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
